objetoCompra:
Serviço de locação de embarcação para navegação em baixo calado
O serviço inclui a disponibilização da embarcação equipada e com o fornecimento de combustível.
- Calado: não superior a 0.2 metros
- Comprimento: no mínimo 6 (seis) metros, no máximo 8 (oito) metros;
- Motorização de popa: potência mínima de 15 HP, potência não superior a 50 HP;
- Convés: aberto ou fechado, porém sem cabine habitável;
- Capacidade: capacidade mínima para 6 tripulantes.

Aquisição por meio inexigibilidade de licitação, de SOLUÇÃO VISCOELÁSTICO OFTÁLMICO:HIALURONATO DE SÓDIO + SULFATO DE CONDROITINA; 30 MG/ML (3%) + 40 MG/ML (4%); SOLUÇÃO INTRAOCULAR, a fim de atender as necessidades do Complexo Hospitalar da Universidade Federal do Rio de Janeiro (CH-UFRJ/Ebserh). A aquisição em tela ocupa papel de destaque dentro do complexo sistema de compras do CH-UFRJ/Ebserh, uma vez que esses materiais são necessários, essenciais e insubstituíveis para a realização de cirurgias oftalmológicas, principalmente nas intervenções de facoemulsificação (cirurgia de catarata), transplantes de córnea, cirurgias de glaucoma e procedimentos de segmento anterior. Este tipo de solução viscoelástica apresenta alta viscosidade e elasticidade, características que permitem: 

Proteção das estruturas intraoculares, como endotélio corneano, durante a manipulação cirúrgica;

Estabilização da câmara anterior do olho durante a cirurgia;

Facilitação da implantação de lentes intraoculares (LIOs);

Redução do trauma cirúrgico e melhora dos desfechos pós-operatórios.

A combinação de hialuronato de sódio com sulfato de condroitina é considerada superior aos viscoelásticos simples, oferecendo melhor desempenho em termos de proteção endotelial e manuseio intraoperatório.

Justificativa: O CH-UFRJ é referência em procedimentos oftalmológicos de média e alta complexidade, atendendo uma ampla demanda de pacientes via SUS. A indisponibilidade deste insumo impacta diretamente a realização das cirurgias eletivas e de urgência, podendo levar à suspensão de procedimentos e ao agravamento de quadros clínicos oftalmológicos. Além disso, o uso de produtos viscoelásticos de menor densidade ou substitutos não equivalentes compromete a segurança e a eficácia dos procedimentos, indo contra as boas práticas clínicas e protocolos da Sociedade Brasileira de Oftalmologia.
